function convertToNumberingScheme(number) {
  var baseChar = ("a").charCodeAt(0),
      letters  = "";

  do {
    number -= 1;
    letters = String.fromCharCode(baseChar + (number % 26)) + letters;
    number = (number / 26) >> 0; // quick `floor`
  } while(number > 0);

  return letters;
}





for(var i = 1; i<200;i++){
	var path = "path_"+convertToNumberingScheme(i);

	console.log(path);
	if(this[path]!=undefined){
		this[path].attr({
			title: path,
		});
		provinces.push(this[path]); 
	}
}


console.log(provinces.length);
for (var i = 0, len = provinces.length; i < len; i++) {

    var el = provinces[i];

    el.tooltip(rsr.rect(0,0,200,200));
    if(el == undefined)
    	continue;


    el.node.style.opacity = 0;

    el.mouseover(function() {
    	this.stop(); // other animations
    	this.attr({       
    		cursor: 'pointer',
            // fill: '#000000',
    	});
        this.toFront();

        this.animate({
            opacity: 0.5,	
        }, 100);
    });
    el.mouseout(function() {
        this.attr({
            // fill: '#000000',
            opacity: 0.5,
        });
        this.animate({
            opacity: 0,
        }, 1000);
    });
    el.click(function() {
        this.animate({
            // fill: 'green'
        }, 200);
    });

}